INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 0, 787, 118501, 0, 450, 0, "カリン", "かりん", 37, 118501, 1, 2.0, 0, 1, 0, 37, 118501, "2021/10/19 12:00:00", 2, "2030/12/31 15:00:00", 0, 118501, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 0, 714, 119001, 0, 450, 0, "イオ（ノワール）", "いお", 7, 119001, 3, 2.27, 0, 0, 0, 7, 119001, "2021/11/03 19:00:00", 2, "2030/12/31 15:00:00", 15, 119001, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 0, 143, 119101, 0, 450, 0, "クウカ（ノワール）", "くうか", 7, 119101, 3, 2.545, 0, 0, 0, 26, 119101, "2021/11/16 12:00:00", 2, "2030/12/31 15:00:00", 12, 119101, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", 0, 397, 119201, 0, 450, 0, "マヒル（クリスマス）", "まひる", 6, 119201, 1, 2.19, 0, 1, 0, 6, 119201, "2023/09/19 15:00:00", 1, "2030/12/31 15:00:00", 5, 119201, 0);
