INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 0, 283, 120701, 0, 450, 0, "シェフィ（ニューイヤー）", "しぇふぃ", 4, 120701, 3, 1.84, 0, 1, 0, 22, 120701, "2024/01/26 12:00:00", 1, "2024/01/31 11:59:59", 1, 120701, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 0, 193, 120801, 0, 450, 0, "ルカ（ニューイヤー）", "るか", 4, 120801, 1, 1.3, 0, 1, 0, 22, 120801, "2023/10/16 15:00:00", 1, "2030/12/31 15:00:00", 2, 120801, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 0, 424, 120901, 0, 450, 0, "イリヤ（ニューイヤー）", "いりや", 3, 120901, 3, 1.425, 0, 1, 0, 38, 120901, "2024/01/26 12:00:00", 2, "2024/01/31 11:59:59", 12, 120901, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 0, 164, 121001, 0, 450, 0, "ペコリーヌ（オーバーロード）", "ぺこりーぬ", 5, 121001, 3, 2.25, 0, 1, 0, 41, 121001, "2024/02/22 12:00:00", 1, "2024/02/29 11:59:59", 1, 121001, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 0, 588, 121101, 0, 450, 0, "キャル（オーバーロード）", "きゃる", 7, 121101, 3, 2.07, 0, 1, 0, 42, 121101, "2024/02/22 12:00:00", 2, "2024/02/29 11:59:59", 1, 121101, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 0, 260, 121201, 0, 450, 0, "ラビリスタ（オーバーロード）", "らびりすた", 4, 121201, 1, 1.55, 0, 1, 0, 40, 121201, "2023/11/16 15:00:00", 1, "2030/12/31 15:00:00", 6, 121201, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 0, 731, 121301, 0, 450, 0, "クルミ（ステージ）", "くるみ", 3, 121301, 3, 1.9, 0, 0, 0, 3, 121301, "2022/03/03 19:00:00", 1, "2030/12/31 15:00:00", 3, 121301, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 0, 742, 121401, 0, 450, 0, "ミサキ（ステージ）", "みさき", 7, 121401, 3, 2.27, 0, 0, 0, 7, 121401, "2022/03/15 15:00:00", 2, "2030/12/31 15:00:00", 15, 121401, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 0, 590, 121501, 0, 450, 0, "アユミ（怪盗）", "あゆみ", 6, 121501, 3, 2.0, 0, 1, 0, 6, 121501, "2024/04/12 12:00:00", 1, "2024/04/15 14:59:59", 12, 121501, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 0, 292, 121601, 0, 450, 0, "イノリ（怪盗）", "いのり", 3, 121601, 3, 1.425, 0, 0, 0, 3, 121601, "2022/04/15 15:00:00", 1, "2030/12/31 15:00:00", 17, 121601, 0);
