INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 0, 293, 121901, 0, 450, 0, "アンナ（パイレーツ）", "あんな", 5, 121901, 3, 2.125, 0, 0, 0, 5, 121901, "2022/05/15 15:00:00", 2, "2030/12/31 15:00:00", 12, 121901, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 0, 380, 122001, 0, 450, 0, "シノブ（パイレーツ）", "しのぶ", 3, 122001, 3, 1.425, 0, 0, 0, 3, 122001, "2022/05/03 19:00:00", 1, "2030/12/31 15:00:00", 14, 122001, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 0, 731, 122101, 0, 450, 0, "アオイ（キャンプ）", "あおい", 35, 122101, 1, 1.97, 0, 1, 0, 35, 122101, "2024/04/18 15:00:00", 1, "2030/12/31 15:00:00", 9, 122101, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 0, 419, 122201, 0, 450, 0, "ユカリ（キャンプ）", "ゆかり", 4, 122201, 3, 1.84, 0, 0, 0, 4, 122201, "2022/05/31 12:00:00", 1, "2030/12/31 15:00:00", 8, 122201, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 0, 564, 122301, 0, 450, 0, "ヴァンピィ", "うぁんぴぃ", 43, 122301, 3, 1.425, 0, 0, 0, 43, 122301, "2022/06/15 15:00:00", 2, "2030/12/31 15:00:00", 0, 122301, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 0, 264, 122401, 0, 450, 0, "ヒヨリ（サマー）", "ひより", 1, 122401, 1, 2.42, 0, 1, 0, 1, 122401, "2024/06/17 15:00:00", 1, "2030/12/31 15:00:00", 8, 122401, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 0, 250, 122501, 0, 450, 0, "レイ（サマー）", "れい", 4, 122501, 3, 1.965, 0, 1, 0, 4, 122501, "2023/07/12 12:00:00", 1, "2023/07/15 14:59:59", 0, 122501, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 0, 554, 122601, 0, 450, 0, "ユイ（サマー）", "ゆい", 7, 122601, 3, 2.27, 0, 0, 0, 7, 122601, "2022/07/15 15:00:00", 2, "2030/12/31 15:00:00", 0, 122601, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 0, 812, 122701, 0, 450, 0, "キョウカ（サマー）", "きょうか", 7, 122701, 3, 1.92, 0, 0, 0, 7, 122701, "2022/08/15 15:00:00", 2, "2030/12/31 15:00:00", 0, 122701, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 0, 237, 122801, 0, 450, 0, "ミソギ（サマー）", "みそぎ", 1, 122801, 1, 2.295, 0, 1, 0, 1, 122801, "2024/07/16 15:00:00", 1, "2030/12/31 15:00:00", 0, 122801, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 0, 361, 122901, 0, 450, 0, "ミミ（サマー）", "みみ", 5, 122901, 3, 2.25, 0, 1, 0, 5, 122901, "2023/08/09 12:00:00", 1, "2023/08/12 11:59:59", 0, 122901, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 0, 746, 123001, 0, 450, 0, "アメス", "あめす", 44, 123001, 3, 2.27, 0, 1, 0, 44, 123001, "2024/06/30 12:00:00", 2, "2024/07/03 18:59:59", 0, 123001, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 0, 793, 123101, 0, 450, 0, "マホ（エクスプローラー）", "まほ", 7, 123101, 3, 1.795, 0, 0, 0, 7, 123101, "2022/09/03 19:00:00", 2, "2030/12/31 15:00:00", 0, 123101, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 0, 256, 123201, 0, 450, 0, "アヤネ（エクスプローラー）", "あやね", 3, 123201, 3, 1.425, 0, 0, 0, 3, 123201, "2022/09/15 15:00:00", 1, "2030/12/31 15:00:00", 0, 123201, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 0, 350, 123301, 0, 450, 0, "ネア", "ねあ", 1, 123301, 3, 1.62, 0, 1, 0, 0, 123301, "2023/09/12 12:00:00", 1, "2023/09/15 14:59:59", 0, 123301, 0);
