INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 0, 583, 123501, 0, 450, 0, "リン（ハロウィン）", "りん", 6, 123501, 1, 2.34, 1, 1, 0, 6, 123501, "2022/09/30 12:00:00", 1, "2030/12/31 15:00:00", 0, 123501, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 0, 262, 123601, 0, 450, 0, "トモ（ハロウィン）", "とも", 4, 123601, 3, 1.965, 0, 1, 0, 4, 123601, "2023/10/10 12:00:00", 1, "2023/10/15 14:59:59", 0, 123601, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 0, 741, 123701, 0, 450, 0, "ナナカ（ハロウィン）", "ななか", 7, 123701, 3, 2.07, 0, 0, 0, 21, 123701, "2022/10/15 15:00:00", 2, "2030/12/31 15:00:00", 0, 123701, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 0, 238, 123801, 0, 450, 0, "クリスティーナ（ワイルド）", "くりすてぃーな", 1, 123801, 3, 2.295, 0, 1, 0, 1, 123801, "2023/11/10 12:00:00", 1, "2023/11/15 14:59:59", 0, 123801, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 0, 183, 123901, 0, 450, 0, "マツリ（ワイルド）", "まつり", 2, 123901, 3, 2.125, 0, 0, 0, 2, 123901, "2022/11/15 15:00:00", 1, "2030/12/31 15:00:00", 0, 123901, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 0, 438, 124001, 0, 450, 0, "アカリ（クリスマス）", "あかり", 7, 124001, 3, 2.07, 0, 1, 0, 7, 124001, "2023/12/11 12:00:00", 2, "2023/12/15 14:59:59", 0, 124001, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 0, 433, 124101, 0, 450, 0, "ヨリ（クリスマス）", "より", 6, 124101, 1, 1.965, 1, 1, 0, 6, 124101, "2022/11/30 12:00:00", 2, "2030/12/31 15:00:00", 0, 124101, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 0, 144, 124201, 0, 450, 0, "ジュン（クリスマス）", "じゅん", 5, 124201, 3, 2.07, 0, 0, 0, 5, 124201, "2022/12/23 12:00:00", 1, "2030/12/31 15:00:00", 0, 124201, 0);
