INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 0, 707, 124501, 0, 450, 0, "ホマレ（ニューイヤー）", "ほまれ", 7, 124501, 3, 2.07, 0, 1, 0, 21, 124501, "2024/01/12 12:00:00", 2, "2024/01/15 14:59:59", 0, 124501, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 0, 698, 124601, 0, 450, 0, "ミサト（ニューイヤー）", "みさと", 7, 124601, 3, 2.44, 0, 1, 0, 21, 124601, "2024/01/12 12:00:00", 2, "2024/01/15 14:59:59", 0, 124601, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 0, 590, 124701, 0, 450, 0, "ミツキ（ニューイヤー）", "みつき", 7, 124701, 1, 2.24, 1, 1, 0, 46, 124701, "2022/12/31 12:00:00", 1, "2030/12/31 15:00:00", 0, 124701, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 0, 423, 124801, 0, 450, 0, "ノゾミ（リベレイター）", "のぞみ", 4, 124801, 3, 2.14, 0, 1, 0, 0, 124801, "2024/02/12 12:00:00", 1, "2024/02/14 23:59:59", 0, 124801, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 0, 170, 124901, 0, 450, 0, "カヤ（リベレイター）", "かや", 1, 124901, 1, 1.965, 1, 1, 0, 0, 124901, "2023/01/31 12:00:00", 1, "2030/12/31 15:00:00", 0, 124901, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 0, 221, 125001, 0, 450, 0, "ムイミ（リベレイター）", "むいみ", 5, 125001, 3, 1.965, 0, 1, 0, 0, 125001, "2024/02/12 12:00:00", 1, "2024/02/14 23:59:59", 0, 125001, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 0, 825, 125101, 0, 450, 0, "タマキ（カフェ）", "たまき", 8, 125101, 3, 2.24, 0, 0, 0, 47, 125101, "2023/03/03 19:00:00", 1, "2030/12/31 15:00:00", 0, 125101, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 0, 463, 125201, 0, 450, 0, "モニカ（カフェ）", "もにか", 4, 125201, 3, 1.965, 0, 0, 0, 4, 125201, "2023/03/10 12:00:00", 1, "2030/12/31 15:00:00", 0, 125201, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 0, 752, 125301, 0, 450, 0, "コッコロ（レンジャー）", "こっころ", 6, 125301, 3, 2.07, 0, 1, 0, 6, 125301, "2024/04/12 12:00:00", 1, "2024/04/15 14:59:59", 0, 125301, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 0, 710, 125401, 0, 450, 0, "シオリ（レンジャー）", "しおり", 8, 125401, 3, 2.09, 0, 0, 0, 8, 125401, "2023/04/10 12:00:00", 1, "2030/12/31 15:00:00", 0, 125401, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 0, 443, 125501, 0, 450, 0, "ジータ（ウォーロック）", "じーた", 7, 125501, 3, 1.92, 0, 1, 0, 50, 125501, "2024/05/10 12:00:00", 2, "2024/05/15 14:59:59", 0, 125501, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 0, 267, 125601, 0, 450, 0, "ビカラ", "びから", 51, 125601, 3, 2.09, 0, 1, 0, 0, 125601, "2024/05/10 12:00:00", 1, "2024/05/15 14:59:59", 0, 125601, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 0, 579, 125701, 0, 450, 0, "カリン（アルケミスト）", "かりん", 7, 125701, 1, 2.24, 1, 1, 0, 9, 125701, "2023/04/30 12:00:00", 2, "2030/12/31 15:00:00", 0, 125701, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 0, 464, 125801, 0, 450, 0, "リリ（フォールン）", "りり", 3, 125801, 3, 2.09, 0, 0, 0, 0, 125801, "2023/04/17 12:00:00", 1, "2030/12/31 15:00:00", 0, 125801, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("", 0, 0, 125901, 0, 0, 0, "カヤ（リベレイター）", "かや", 1, 125901, 3, 0.0, 0, 1, 0, 1, 0, "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00", 0, 0, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 0, 406, 126001, 0, 450, 0, "クリア（フォールン）", "くりあ", 0, 126001, 3, 2.09, 0, 0, 0, 0, 126001, "2023/10/31 12:00:00", 1, "2030/12/31 15:00:00", 0, 126001, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 0, 480, 126101, 0, 450, 0, "プレシア（フォールン）", "ぷれしあ", 44, 126101, 3, 2.09, 0, 0, 0, 53, 126101, "2023/11/15 15:00:00", 2, "2030/12/31 15:00:00", 0, 126101, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 0, 568, 126201, 0, 450, 0, "イリヤ（儀装束）", "いりや", 3, 126201, 3, 2.09, 0, 1, 0, 3, 126201, "2024/06/10 12:00:00", 2, "2024/06/15 14:59:59", 0, 126201, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 0, 456, 126301, 0, 450, 0, "ユキ（儀装束）", "ゆき", 7, 126301, 3, 2.07, 0, 0, 0, 9, 126301, "2023/06/15 15:00:00", 2, "2030/12/31 15:00:00", 0, 126301, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 0, 373, 126401, 0, 450, 0, "クローチェ", "くろーちぇ", 1, 126401, 3, 2.09, 0, 1, 0, 1, 126401, "2024/06/30 12:00:00", 1, "2024/07/03 18:59:59", 0, 126401, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 0, 740, 126501, 0, 450, 0, "ライラエル", "らいらえる", 7, 126501, 3, 1.965, 0, 1, 0, 0, 126501, "2024/06/30 12:00:00", 2, "2024/07/03 18:59:59", 0, 126501, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 0, 650, 126601, 0, 450, 0, "ネネカ（サマー）", "ねねか", 7, 126601, 3, 2.04, 0, 1, 0, 7, 126601, "2024/07/11 12:00:00", 2, "2024/07/15 14:59:59", 0, 126601, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 0, 224, 126701, 0, 450, 0, "アキノ（サマー）", "あきの", 5, 126701, 1, 1.965, 1, 1, 0, 5, 126701, "2023/06/30 12:00:00", 1, "2030/12/31 15:00:00", 0, 126701, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 0, 159, 126801, 0, 450, 0, "ユカリ（サマー）", "ゆかり", 5, 126801, 3, 1.97, 0, 0, 0, 5, 126801, "2023/07/15 15:00:00", 1, "2030/12/31 15:00:00", 0, 126801, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 0, 682, 126901, 0, 450, 0, "ランファ（サマー）", "らんふぁ", 7, 126901, 3, 1.965, 0, 1, 0, 21, 126901, "2024/03/18 12:00:00", 2, "2024/03/22 11:59:59", 0, 126901, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 0, 133, 127001, 0, 450, 0, "クウカ（サマー）", "くうか", 2, 127001, 1, 1.97, 1, 1, 0, 52, 127001, "2023/07/31 12:00:00", 1, "2023/08/14 20:59:59", 0, 127001, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 0, 255, 127101, 0, 450, 0, "シノブ（サマー）", "しのぶ", 5, 127101, 3, 2.09, 0, 1, 0, 46, 127101, "2024/03/18 12:00:00", 1, "2024/03/22 11:59:59", 0, 127101, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 0, 804, 127201, 0, 450, 0, "キャル（編入生）", "きゃる", 7, 127201, 3, 2.09, 0, 1, 0, 7, 127201, "2024/03/28 12:00:00", 2, "2024/03/31 11:59:59", 0, 127201, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 0, 750, 127301, 0, 450, 0, "スズナ（編入生）", "すずな", 8, 127301, 3, 2.09, 0, 0, 0, 8, 127301, "2023/09/15 15:00:00", 1, "2030/12/31 15:00:00", 0, 127301, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("", 0, 0, 127401, 0, 0, 0, "ビカラ（コラボ）", "びから", 1, 127401, 3, 0.0, 0, 1, 0, 1, 0, "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00", 0, 0, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 0, 304, 127501, 0, 450, 0, "サレン（サラサリア）", "されん", 4, 127501, 3, 2.09, 0, 1, 0, 4, 127501, "2024/04/26 12:00:00", 1, "2024/04/30 11:59:59", 0, 127501, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 0, 157, 127601, 0, 450, 0, "ルカ（サラサリア）", "るか", 4, 127601, 3, 1.965, 0, 0, 0, 4, 127601, "2023/10/15 15:00:00", 1, "2030/12/31 15:00:00", 0, 127601, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 0, 372, 127901, 0, 450, 0, "ペコリーヌ（クリスマス）", "ぺこりーぬ", 5, 127901, 3, 1.965, 0, 1, 0, 5, 127901, "2024/05/27 12:00:00", 2, "2024/05/31 11:59:59", 0, 127901, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 0, 723, 128001, 0, 450, 0, "クレジッタ（クリスマス）", "くれじった", 35, 128001, 3, 2.09, 0, 0, 0, 35, 128001, "2023/12/15 15:00:00", 1, "2030/12/31 15:00:00", 0, 128001, 0);
