INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 0, 191, 128301, 0, 450, 0, "イノリ（ニューイヤー）", "いのり", 3, 128301, 1, 2.09, 1, 1, 0, 38, 128301, "2023/12/31 12:00:00", 1, "2030/12/31 15:00:00", 0, 128301, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 0, 801, 128401, 0, 450, 0, "ハツネ（ニューイヤー）", "はつね", 7, 128401, 3, 2.09, 0, 1, 0, 21, 128401, "2024/06/26 12:00:00", 2, "2024/06/30 11:59:59", 0, 128401, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 0, 739, 128501, 0, 450, 0, "カスミ（ニューイヤー）", "かすみ", 7, 128501, 3, 2.09, 0, 1, 0, 21, 128501, "2024/06/26 12:00:00", 2, "2024/06/30 11:59:59", 0, 128501, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("", 0, 0, 128601, 0, 0, 0, "リリ（フォールン）", "りり", 1, 128601, 3, 0.0, 0, 1, 0, 1, 0, "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00", 0, 0, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 0, 226, 128701, 0, 450, 0, "ヒヨリ（アストラル）", "ひより", 1, 128701, 3, 2.09, 0, 1, 0, 0, 128701, "2024/02/15 00:00:00", 1, "2024/02/22 11:59:59", 0, 128701, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 0, 194, 128801, 0, 450, 0, "レイ（アストラル）", "れい", 4, 128801, 1, 1.965, 1, 1, 0, 0, 128801, "2024/01/31 12:00:00", 1, "2030/12/31 15:00:00", 0, 128801, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 0, 772, 128901, 0, 450, 0, "ユイ（アストラル）", "ゆい", 7, 128901, 3, 2.09, 0, 1, 0, 0, 128901, "2024/01/31 12:00:00", 2, "2024/02/12 11:59:59", 0, 128901, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 0, 800, 129001, 0, 450, 0, "エリス", "えりす", 7, 129001, 3, 2.09, 0, 1, 0, 0, 129001, "2024/06/30 12:00:00", 2, "2024/07/03 18:59:59", 0, 129001, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 0, 708, 129301, 0, 450, 0, "ユニ（ウィンター）", "ゆに", 7, 129301, 3, 2.09, 0, 1, 0, 7, 129301, "2024/03/03 19:00:00", 1, "2024/03/11 11:59:59", 0, 129301, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 0, 188, 129401, 0, 450, 0, "クロエ（ウィンター）", "くろえ", 2, 129401, 3, 2.09, 0, 0, 0, 2, 129401, "2024/03/18 12:00:00", 1, "2030/12/31 15:00:00", 0, 129401, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 0, 550, 129601, 0, 450, 0, "アネモネ", "あねもね", 0, 129601, 3, 2.09, 0, 1, 0, 0, 129601, "2024/06/30 12:00:00", 1, "2024/07/03 18:59:59", 0, 129601, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 0, 540, 129701, 0, 450, 0, "ネフィ＝ネラ", "ねふぃーねら", 0, 129701, 3, 2.09, 0, 1, 0, 0, 129701, "2024/06/30 12:00:00", 1, "2024/07/03 18:59:59", 0, 129701, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 0, 269, 129801, 0, 450, 0, "マコト（コマンダー）", "まこと", 5, 129801, 3, 2.09, 0, 1, 0, 5, 129801, "2024/03/31 12:00:00", 1, "2024/04/12 11:59:59", 0, 129801, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 0, 294, 129901, 0, 450, 0, "エリコ（コマンダー）", "えりこ", 6, 129901, 3, 1.84, 0, 0, 0, 48, 129901, "2024/04/15 15:00:00", 1, "2030/12/31 15:00:00", 0, 129901, 0);
