INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 0, 563, 130701, 0, 450, 0, "キョウカ（スプリング）", "きょうか", 7, 130701, 3, 1.92, 0, 1, 0, 7, 130701, "2024/05/03 19:00:00", 2, "2024/05/15 14:59:59", 0, 130701, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 0, 558, 130801, 0, 450, 0, "スズメ（スプリング）", "すずめ", 7, 130801, 3, 1.84, 0, 0, 0, 7, 130801, "2024/05/15 15:00:00", 2, "2030/12/31 15:00:00", 0, 130801, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 0, 440, 130901, 0, 450, 0, "クルル", "くるる", 7, 130901, 3, 2.09, 0, 0, 0, 7, 130901, "2024/06/15 15:00:00", 2, "2030/12/31 15:00:00", 0, 130901, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 0, 702, 131001, 0, 450, 0, "マホ（ドリームパーク）", "まほ", 7, 131001, 3, 1.84, 0, 1, 0, 7, 131001, "2024/05/31 12:00:00", 2, "2024/06/10 11:59:59", 0, 131001, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES ("【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 0, 165, 131101, 0, 450, 0, "ネア（サマー）", "ねあ", 2, 131101, 3, 2.09, 0, 0, 0, 52, 131101, "2024/06/30 12:00:00", 1, "2030/12/31 15:00:00", 0, 131101, 0);
